import MenuItem from "./MenuItem/MenuItem"

const Menu = (({className, menuItems}) => {
  return (
    <ul data-name="menu" class="header__menu">
      <li className={`${className}__item`}>
        {menuItems.lenght && 
          menuItems.map(item => <MenuItem item={item}/>)
        }    
    </li>
    </ul>
  )
})

export default Menu
